var fixedLifts = _.map(rawLifts,function(lift){
    var lps = _.map(lift.liftPoints.split(';'),function(i){return _.map(i.split(','),function(j){return parseFloat(j)})});
    //milli,      accel,    vel,   height, elevation, zaccel, pith

    lift.acceleration = _.map(lps,function(i){return [i[0],(i[1]/9.8+1)*8192] });
    lift.kalman = _.map(lps,function(i){return [i[0],i[1],i[2],i[3]] });
    lift.dmpData = _.map(lps,function(i){return [i[0],i[5],i[6]] });
    lift.altitude = _.map(lps,function(i){return [i[0],i[4]] });

    delete lift.liftPoints

    return lift;
});
    


app.service('FormData', function(Lift,$rootScope) {
    this.lifts = [];  //This is the liftTypeID of the current lift
    this.selectedLift = 0;

    this.metrics = {};


    _.each(fixedLifts,function(lift){
        this.lifts.push(new Lift(lift));
    },this);

    this.updateMetrics = function(idx){
        this.metrics['numOfLifts'] = this.lifts.length;
        this.metrics['avgRest'] = 126;
        this.metrics['totalWork'] = 42;
    }

    this.setSelLift = function(idx){
        if(idx!=undefined){
            this.selectedLift = idx;
        }
        console.log('broadcast');
        $rootScope.$broadcast('newLiftSelected', 
                  {lift:this.lifts[this.selectedLift]});
    }
    this.getSelLift = function(){
      return this.lifts[this.selectedLift];
    }

     this.updateMetrics();
    this.setSelLift(0);


});